package day8.forloopExamples;

public class Example9 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=0;i<5;i++) {
			System.out.println("Hello i:"+i);
				for(int j=0;j<4;j++) {
					System.out.println("\tHi j:"+j);
						for(int k=0;k<3;k++) {
							System.out.println("\t\tBye K:"+k);
						}
				}
		}
	}
}





